/100 ca phi cng iu khin. Mt vi mu c c 1/20 ca phi cng.&nbsp;u nm 2002 mecha designer Hajime Katoki bt u thit k li hng lot Mobile Suits v ra mt chng trong dng Master Grade di tn gi Ver.Ka (Katori Version). Hu ht cc phin bn Ver.ka c sn xut l do kt qu bnh chn ca fan hng nm.&nbsp;Ngoi gundam ra th mt s phim mecha v anime ni ting khc cng c sn xut c MG nh Dragon Ball Z, One Piece.&lt;/p&gt;\r\n&lt;h2&gt;&lt;strong&gt;DNG C RP GUNDAM&lt;/strong&gt;&lt;/h2&gt;\r\n&lt;p&gt;Khng ch Gundam, chng ta cn c cc ph kin v dng c  lp rp m hnh Gundam cho bn nh km, bt k ln, bt xa, dng c sn, t Gp phn tn vinh v p m hnh Gundam ca bn hn.&lt;/p&gt;\r\n&lt;p&gt;Cui cng, cho mng bn n vi th gii Gundam  TAB Store  Chuyn trang cung cp thng tin hu ch nht v Gunpla ti Vit Nam&lt;/p&gt;\r\n&lt;p&gt;&nbsp;&lt;/p&gt;\r\n&lt;p&gt;NHN ORDER T 7-14 NGY I VI NHNG MT HNG KHNG C SN&lt;/p&gt;\r\n&lt;p&gt;MI CHI TIT XIN LIN H VI CA HNG TAB Store&nbsp; qua thng tin trn website.&lt;/p&gt;\r\n&lt;p&gt;TAB Store- V mt tr tu Vit Nam&lt;/p&gt;</div></div></div>'),(61,85,0,30,'Gundam Daban MG Astray Red Frame 8806'),(62,75,0,31,'<style>#html-body [data-pb-style=N91LS8O]{justify-content:flex-start;display:flex;flex-direction:column;background-position:left top;background-size:cover;background-repeat:no-repeat;background-attachment:scroll}</style><div data-content-type=\"row\" data-appearance=\"contained\" data-element=\"main\"><div data-enable-parallax=\"0\" data-parallax-speed=\"0.5\" data-background-images=\"{}\" data-background-type=\"image\" data-video-loop=\"true\" data-video-play-only-visible=\"true\" data-video-lazy-load=\"true\" data-video-fallback-src=\"\" data-element=\"inner\" data-pb-style=\"N91LS8O\"><div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;h1&gt;&lt;strong&gt;M hnh Bandai Gundam MG PLAN303E Deep Striker&lt;/strong&gt;&lt;/h1&gt;\r\n&lt;p&gt;Sn phm Gunpla chnh hng ca Bandai, sn xut ti Nht Bn.&lt;/p&gt;\r\n&lt;p&gt;PHIN BN : MG&lt;/p&gt;\r\n&lt;p&gt;Chiu cao: 18-